  def send_udp(payload, ip, port) do
    GenServer.cast(__MODULE__, {:send_udp, payload, ip, port})
  end

  @doc """
  Parse một dòng log để tách lấy port và message.

  Format log: "YYYY-MM-DD HH:MM:SS: port:PORT - 8=FIX.4.4..."

  ## Examples

      iex> UdpSender.parse_log_line("2026-01-15 15:10:39: port:55622 - 8=FIX.4.4...")
      {:ok, 55622, "8=FIX.4.4..."}

      iex> UdpSender.parse_log_line("invalid line")
      {:error, :invalid_format}
  """
  def parse_log_line(line) when is_binary(line) do
    line = String.trim(line)

    # Tìm vị trí của "port:" và " - "
    case Regex.run(~r/port:(\d+)\s*-\s*(8=FIX\.4\.4.*)/, line) do
      [_, port_str, message] ->
        case Integer.parse(port_str) do
          {port, _} ->
            {:ok, port, message}

          :error ->
            {:error, :invalid_port}
        end

      _ ->
        {:error, :invalid_format}
    end
  end

  def parse_log_line(_), do: {:error, :invalid_format}

  # GenServer callbacks

  def init(:ok) do
    # Open N sockets and store as list
    sockets =
      for _ <- 1..@socket_count do
        {:ok, sock} = :gen_udp.open(0)
        sock
      end

    state = %{sockets: sockets, next: 0}
    {:ok, state}
  end

  def handle_cast({:send_udp, payload, ip, port}, %{sockets: sockets, next: next} = state) do
    socket = Enum.at(sockets, rem(next, @socket_count))
    :gen_udp.send(socket, ip, port, payload)
    {:noreply, %{state | next: next + 1}}
  end

  def terminate(_reason, %{sockets: sockets}) do
    Enum.each(sockets, &:gen_udp.close/1)
    :ok
  end
end
